<script>
import { mapState } from 'vuex'
import { linuxApi } from '@/api'
import { parseTime } from '@/utils'

export default {
  name: 'TaskBg',
  watch: {
    TaskCommitmentDetails(val) {
      val['ID'] && this.getContractAuditRecord(val['ID'])
    }
  },
  computed: {
    ...mapState({
      TaskCommitmentDetails: state => state.inspect.TaskCommitmentDetails
    })
  },
  data() {
    return {
      details: {}
    }
  },
  methods: {
    getContractAuditRecord(ID) {
      linuxApi.getContractAuditRecord({ ID }).then(res => {
        const list = res.data.data
        for (const key in list) {
          const date = new Date(list[key]['审核时间'])
          list[key]['审核时间'] = parseTime(date)
        }
        this.details = res.data.data
      })
    }
  }
}
</script>

